import React from "react";
import { useState } from "react";
import CreateUserScreen from "./CreateUserScreen";
import Directions from "./Directions";
import Login from "./Login";



const PageContent = (props) => {
  const currentPage = props.currentPageName


  if (currentPage === "New-User") {
    return <CreateUserScreen handleUserSubmit={props.handleUserSubmit} onswitch ={props.toggleForm}/>
  }
  if (currentPage === "Directions") {
    return <Directions/>
  }
   if (currentPage === "Login") {
    return <Login setCurrentPageName = {props.toggleForm}/>
   }
}

export default PageContent;
